const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <p>{`The RedisJSON module provides in-memory manipulation of JSON documents at high velocity and volume. With RedisJSON, you can natively store document data in a hierarchical, tree-like format to scale and query documents efficiently, significantly improving performance over storing and manipulating JSON with Lua scripts and core Redis data structures.`}</p>
    <h3 {...{
      "id": "step-1-register-and-subscribe"
    }}>{`Step 1. Register and subscribe`}</h3>
    <p>{`Follow `}<a parentName="p" {...{
        "href": "/create/cloud/rediscloud"
      }}>{`this link to register`}</a>{` and subscribe to Redis Enterprise Cloud`}</p>
    <p><img alt={"RedisJSON"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./redisjson3.png").default} /></p>
    <h3 {...{
      "id": "step-2-create-a-database-with-redisjson-module"
    }}>{`Step 2. Create a database with RedisJSON Module`}</h3>
    <p><img alt={"RedisJSON"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./redisjson1.png").default} /></p>
    <h3 {...{
      "id": "step-3-connect-to-a-database"
    }}>{`Step 3. Connect to a database`}</h3>
    <p>{`Follow `}<a parentName="p" {...{
        "href": "explore/redisinsight"
      }}>{`this`}</a>{` link to know how to connect to a database`}</p>
    <h3 {...{
      "id": "step-4-getting-started-with-redisjson"
    }}>{`Step 4. Getting Started with RedisJSON`}</h3>
    <p>{`The following steps use some basic RedisJSON commands. You can run them from the Redis command-line interface (redis-cli) or use the CLI available in RedisInsight. `}</p>
    <p>{`To interact with RedisJSON, you will most often use the JSON.SET and JSON.GET commands. Before using RedisJSON, you should familiarize yourself with its commands  and syntax as detailed in the documentation: RedisJSON Commands.`}</p>
    <p>{`Let’s go ahead and test drive some JSON-specific operations for setting and retrieving a Redis key with a JSON value:`}</p>
    <ul>
      <li parentName="ul">{`Scalar`}</li>
      <li parentName="ul">{`Objects (including nested objects)`}</li>
      <li parentName="ul">{`Arrays of JSON objects`}</li>
      <li parentName="ul">{`JSON nested objects`}</li>
    </ul>
    <h4 {...{
      "id": "scalar"
    }}>{`Scalar`}</h4>
    <p>{`Under RedisJSON, a key can contain any valid JSON value. It can be scalar, objects or arrays. JSON scalar is basically a string. You will have to use the JSON.SET command to set the JSON value. For new Redis keys the path must be the root, so you will use “.” path in the example below. For existing keys, when the entire path exists, the value that it contains is replaced with the JSON value. Here you will use JSON.SET to set the JSON scalar value to “Hello JSON!” Scalar will contain a string that holds “Hello JSON!”`}</p>
    <b>Command</b>:
    <pre><code parentName="pre" {...{}}>{`JSON.SET greetings .  ' "Hello JSON!" '
`}</code></pre>
    <b>Result</b>:
    <pre><code parentName="pre" {...{}}>{`OK
`}</code></pre>
    <p>{`Use JSON.GET to return the value at path in JSON serialized form:`}</p>
    <b>Command</b>:
    <pre><code parentName="pre" {...{}}>{`JSON.GET greetings
`}</code></pre>
    <b>Result</b>:
    <pre><code parentName="pre" {...{}}>{`"\\"Hello JSON!\\""
`}</code></pre>
    <h4 {...{
      "id": "objects"
    }}>{`Objects`}</h4>
    <p>{`Let’s look at a JSON object example. A JSON object contains data in the form of a key-value pair. The keys are strings and the values are the JSON types. Keys and values are separated by a colon. Each entry (key-value pair) is separated by a comma. The { (curly brace) represents the JSON object:`}</p>
    <pre><code parentName="pre" {...{}}>{`{  
    "employee": {  
        "name": "alpha",   
        "age": 40,   
        "married": true  
    }  
}
`}</code></pre>
    <p>{`Here is the command to insert JSON data into Redis:`}</p>
    <b>Command</b>:
    <pre><code parentName="pre" {...{}}>{`JSON.SET employee_profile $ '{ "employee": { "name": "alpha", "age": 40,"married": true }  } '
`}</code></pre>
    <div {...{
      "className": "admonition admonition-important alert alert--info"
    }}><div parentName="div" {...{
        "className": "admonition-heading"
      }}><h5 parentName="div"><span parentName="h5" {...{
            "className": "admonition-icon"
          }}><svg parentName="span" {...{
              "xmlns": "http://www.w3.org/2000/svg",
              "width": "14",
              "height": "16",
              "viewBox": "0 0 14 16"
            }}><path parentName="svg" {...{
                "fillRule": "evenodd",
                "d": "M7 2.3c3.14 0 5.7 2.56 5.7 5.7s-2.56 5.7-5.7 5.7A5.71 5.71 0 0 1 1.3 8c0-3.14 2.56-5.7 5.7-5.7zM7 1C3.14 1 0 4.14 0 8s3.14 7 7 7 7-3.14 7-7-3.14-7-7-7zm1 3H6v5h2V4zm0 6H6v2h2v-2z"
              }}></path></svg></span>{`important`}</h5></div><div parentName="div" {...{
        "className": "admonition-content"
      }}><p parentName="div">{`Please note that the above command works for 2.0+ release of RedisJSON. If you are using the older version of RedisJSON, you can replace "$" with "."`}</p></div></div>
    <b>Result</b>:
    <pre><code parentName="pre" {...{}}>{`"OK"
`}</code></pre>
    <p>{`The subcommands below change the reply’s format and are all set to the empty string by default: `}<em parentName="p">{` INDENT sets the indentation string for nested levels `}</em>{`. NEWLINE sets the string that’s printed at the end of each line. * SPACE sets the string that’s put between a key and a value:`}</p>
    <b>Command</b>:
    <pre><code parentName="pre" {...{}}>{`JSON.GET employee_profile
`}</code></pre>
    <b>Result</b>:
    <pre><code parentName="pre" {...{}}>{`"{\\"employee\\":{\\"name\\":\\"alpha\\",\\"age\\":40,\\"married\\":true}}"
`}</code></pre>
    <h4 {...{
      "id": "retrieving-a-part-of-json-document"
    }}>{`Retrieving a part of JSON document`}</h4>
    <p>{`You can also retrieve a part of the JSON document from Redis. In the example below, “.ans” can be passed in the commandline to retrieve the value 4:`}</p>
    <b>Command</b>:
    <pre><code parentName="pre" {...{}}>{`JSON.SET object . '{"foo":"bar", "ans":"4" }'
`}</code></pre>
    <b>Result</b>:
    <pre><code parentName="pre" {...{}}>{`"OK"
`}</code></pre>
    <b>Command</b>:
    <pre><code parentName="pre" {...{}}>{`JSON.GET object
`}</code></pre>
    <b>Result</b>:
    <pre><code parentName="pre" {...{}}>{`"{\\"foo\\":\\"bar\\",\\"ans\\":\\"4\\"}"
`}</code></pre>
    <b>Command</b>:
    <pre><code parentName="pre" {...{}}>{`JSON.GET object .ans
`}</code></pre>
    <b>Results</b>:
    <pre><code parentName="pre" {...{}}>{`"\\"4\\""
`}</code></pre>
    <h4 {...{
      "id": "retrieving-the-type-of-json-data"
    }}>{`Retrieving the type of JSON data`}</h4>
    <p>{`JSON.TYPE reports the type of JSON value at path and path defaults to root if not provided. If the key or path do not exist, null is returned.`}</p>
    <b>Command</b>:
    <pre><code parentName="pre" {...{}}>{`JSON.TYPE employee_profile
`}</code></pre>
    <b>Result:</b>
    <pre><code parentName="pre" {...{}}>{`"Object"
`}</code></pre>
    <h4 {...{
      "id": "json-arrays-of-objects"
    }}>{`JSON arrays of objects`}</h4>
    <p>{`The JSON array represents an ordered list of values. A JSON array can store multiple values, including strings, numbers, or objects. In JSON arrays, values must be separated by a comma. The [ (square bracket) represents the JSON array. Let’s look at a simple JSON array example with four objects:`}</p>
    <pre><code parentName="pre" {...{}}>{`{"employees":[    
    {"name":"Alpha", "email":"alpha@gmail.com", "age":23},    
    {"name":"Beta", "email":"beta@gmail.com", "age":28},  
    {"name":"Gamma", "email":"gamma@gmail.com", "age":33},    
    {"name":"Theta", "email":"theta@gmail.com", "age":41}   
]}  
`}</code></pre>
    <b>Command</b>:
    <pre><code parentName="pre" {...{}}>{`JSON.SET testarray .  '{"employees":[         {"name":"Alpha", "email":"alpha@gmail.com", "age":23},         {"name":"Beta", "email":"beta@gmail.com", "age":28},       {"name":"Gamma", "email":"gamma@gmail.com", "age":33},         {"name":"Theta", "email":"theta@gmail.com", "age":41}    ]}   '
`}</code></pre>
    <b>Result:</b>
    <pre><code parentName="pre" {...{}}>{`"OK"
`}</code></pre>
    <b>Command</b>:
    <pre><code parentName="pre" {...{}}>{`JSON.GET testarray
`}</code></pre>
    <b>Result:</b>
    <pre><code parentName="pre" {...{}}>{`"{\\"employees\\":[{\\"name\\":\\"Alpha\\",\\"email\\":\\
alpha@gmail.com

\\",\\"age\\":23},{\\"name\\":\\"Beta\\",\\"email\\":\\"beta@gmail.com....
`}</code></pre>
    <h4 {...{
      "id": "json-nested-objects"
    }}>{`JSON nested objects`}</h4>
    <p>{`A JSON object can also have another object. Here is a simple example of a JSON object having another object nested in it:`}</p>
    <b>Command</b>:
    <pre><code parentName="pre" {...{}}>{`>> JSON.SET employee_info . ' { "firstName": "Alpha",         "lastName": "K", "age": 23,        "address" : {            "streetAddress": "110 Fulbourn Road Cambridge",  "city": "San Francisco", "state": "California", "postalCode": "94016"  } } '
`}</code></pre>
    <b>Command</b>: 
    <pre><code parentName="pre" {...{}}>{`>> JSON.GET employee_info
`}</code></pre>
    <b>Result</b>:
    <pre><code parentName="pre" {...{}}>{`"{\\"firstName\\":\\"Alpha\\",\\"lastName\\":\\"K\\",\\"age\\":23,\\"address\\":{\\"streetAddress\\":\\"110 Fulbourn Road Cambridge\\",\\"city\\":\\"San Francisco\\",\\"state\\":\\"California\\",\\"postalCode\\":\\"94016\\"}}"
`}</code></pre>
    <h3 {...{
      "id": "next-step"
    }}>{`Next Step`}</h3>
    <ul>
      <li parentName="ul"><a parentName="li" {...{
          "href": "/howtos/redisjson/using-python"
        }}>{`RedisJSON and Python`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "/howtos/redisjson/storing-complex-json-document"
        }}>{`How to store and retrieve nested JSON document`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "/howtos/redisjson/using-nodejs"
        }}>{`Importing JSON data into Redis using NodeJS`}</a>{` `}</li>
      <li parentName="ul">{`Learn more about `}<a parentName="li" {...{
          "href": "https://oss.redislabs.com/redisjson/"
        }}>{`RedisJSON`}</a>{` in the Quickstart tutorial.`}</li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "/howtos/shoppingcart"
        }}>{`How to build shopping cart app using NodeJS and RedisJSON`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "https://redislabs.com/blog/index-and-query-json-docs-with-redis/"
        }}>{`Indexing, Querying, and Full-Text Search of JSON Documents with Redis`}</a></li>
    </ul>
    </MDXLayout>;
}

;
MDXContent.isMDXComponent = true;
